      times.map(function(line) {
        var key, keys, i, newData;
        // Data is a hashed object, Array.reverse will not work
        keys = [];
        for (key in line.data) {
          keys.push(key);
        }
        newData = {};
        for (i = keys.length - 1; i >= 0; i--) {
          newData[keys[i]] = line.data[keys[i]];
        }
        line.data = newData;
      });
    }

    legendWidth = (runIds.length > 1 || allValues.length !== this.snapshotSubPaths.length) ? 100 : 10;
    firstLabelGutter = 30;
    yAxisGutter = 50;
    yAxisName = '';
    if (config.group) {
      yAxisName += config.group + ' | ';
    }
    if (config.title) {
      yAxisName += config.title;
    } else if (config.header) {
      yAxisName += config.header;
    } else {
      // FIXME: use cdnDataManager.translateMetricName
      yAxisName += config.metric;
    }
    configuration = {
      arSeries: times,
      colorName: names,
      transXLabel: xAxisLabels,
      yAxisName: yAxisName,
      legendWidth: legendWidth,
      width: (yAxisGutter + firstLabelGutter + (Math.max(0, (xAxisCount - 1)) * 30) + legendWidth)
    };
    if (seconds) {
      configuration.fnRendValue = function(seconds) {
        return CDNDataCell.renderSeconds(seconds, 0);
      };
    }
    container.appendChild(timeGraph.init(configuration));
  };

  CDNTable.prototype._prepareTreemap = function(index, config, comparisons, cell, container) {
    if (cdnDataManager.getComparisonMethod() === cdnDataManager.COMPARE_RUNS) {
      // Hopefully shortcut any fetches by fetching the comparable objects at the
      // current level so the metric comparisons don't have to fetch the
      // individual subPaths.
      cdnDataManager.getComparableThings(function(){});
    }
    CDNHelpers.waitForAll(comparisons, function(comparison, intermediate) {
      comparison.getValueDescriptions(intermediate);
    }.bind(this), this._renderTreemap.bind(this, index, config, comparisons, cell, container));
  };

  CDNTable.prototype._renderTreemap = function(index, config, comparisons, cell, container, allValues) {
    var runIds, configuration, data, i, j, k, rowDesc, name, fullName, goldCol, branch, found, child, components, treemap, keys;

    cell && cell.removeAttribute('data-fetching');
    runIds = cdnDataManager.getComparableLabels();
    // GOLD POSITION
    runIds.unshift(runIds.pop());

    goldCol = runIds.length - 1;

    data = {
      name: 'Top',
      fullName: 'Top',
      size: 0,
      children: [],
      comparisons: []
    };

    if (this.config.hierarchical_separator) {
      nextRow: for (i = 0; i < allValues.length; i++) {
        branch = data;
        keys = this.keyNames[i % this.keyNames.length].split("\n");
        fullName = this.dataRowNames[i];
        if (this.config.per_snapshot) {
          name = this.prettyRowNames[i].split("\n")[0];
        } else {
          name = '';
        }
        components = [];
        if (keys.length) {
          // Assume single key and single replacement
          components = keys[0].split(this.config.hierarchical_separator);
          if (name) {
            name += ' | ';
          }
          name += components[components.length - 1];
        }
        for (j = 0; j < components.length - 1; j++) {
          found = false;
          for (k = 0; k < branch.children.length; k++) {
            if (branch.children[k].name === components[j]) {
              found = true;
              branch = branch.children[k];
              break;
            }
          }
          if (! found) {
            console.warn('CDNHorizontalTable: Hierarchy has missing elements - not adding '+keys[0]+' to treemap');
            continue nextRow;
          }
        }
        child = {
          name: name,
          fullName: fullName,
          children: [],
          comparisons: []
        };
        branch.children.push(child);
        allValues[i].map(function(value, i) {
          var rawValue = 0;
          if (value.defined && value.number) {
            rawValue = value.rawValue;
          }
          if (i === goldCol) {
            child.size = rawValue;
            if (branch === data) {
              data.size += rawValue;
            }
          } else {
            child.comparisons.push(value.defined && value.number ? rawValue : undefined);
            if (branch === data) {
              if (! data.comparisons[i]) {
                data.comparisons[i] = 0;
              }
              data.comparisons[i] += rawValue;
            }
          }
        });
      }
    } else {
      for (i = 0; i < allValues.length; i++) {
        keys = this.keyNames[i % this.keyNames.length].split("\n");
        if (this.config.per_snapshot) {
          name = fullName.split("\n")[0];
        } else {
          name = '';
        }
        if (keys.length) {
          if (name) {
            name += ' | ';
          }
          name += keys.map(function(key) {return key.replacements.join(' | ');}).join(' | ');
        }
        child = {
          name: name,
          fullName: name,
          children: [],
          comparisons: []
        };
        data.children.push(child);
        allValues[i].map(function(value, i) {
          var rawValue = 0;
          if (value.defined && value.number) {
            rawValue = value.rawValue;
          }
          if (i === goldCol) {
            child.size = rawValue;
            data.size += rawValue;
          } else {
            child.comparisons.push(value.defined && value.number ? rawValue : undefined);
            if (! data.comparisons[i]) {
              data.comparisons[i] = 0;
            }
            data.comparisons[i] += rawValue;
          }
        });
      }
    }

    if (data.children.length === 1) {
      // If we have one top-level metric, promote it to the root.
      data.comparisons = data.children[0].comparisons;
      data.size = data.children[0].size;
      data.name = data.children[0].name;
      data.fullName = data.children[0].fullName;
      data.children = data.children[0].children;
    }

    configuration = {
      series: data,
      comparisonNames: runIds.slice(0, -1).map(function(id){return id.renderedValue;}),
      pathSeparator: this.config.hierarchical_separator || '/'
    };

    treemap = new CDNTreemap();
    container.appendChild(treemap.init(configuration));
  };

  CDNTable.prototype._prepareColumnGraph = function() {
    var i, j, rowComparisons, snapKey, desc;

    rowComparisons = [];

    // Pull out the comparison objects from the metricValue cells
    for (i = 0; i < this.prototypeDescriptions.length; i++) {
      snapKey = undefined;
      for (j = 0; j < this.prototypeDescriptions[i].length; j++) {
        desc = this.prototypeDescriptions[i][j];
        if (desc && desc.type === 'metricValue' && desc.comparison) {
          if (!snapKey) {
            snapKey = [];
            rowComparisons.push(snapKey);
          }
          snapKey.push(desc.comparison);
        }
      }
    }

    CDNHelpers.waitForAll(rowComparisons, function(colComparisons, intermediate) {
      CDNHelpers.waitForAll(colComparisons, function(comparison, intermediate) {
        comparison.getValueDescriptions(intermediate);
      }, intermediate);
    }, this._renderColumnGraph.bind(this));
  };
  CDNTable.prototype._renderColumnGraph = function(descriptions) {
    var chart, series, columnLabels, i, j, metric, value, colorNames, name;

    series = [
      {
        name: 'Good',
        color: 'rgba(40, 197, 26, 0.7)',
        data: {}
      },
      {
        name: 'No Change',
        color: 'rgba(220, 220, 220, 0.7)',
        data: {}
      },
      {
        name: 'No Result',
        color: 'rgba(140, 140, 140, 0.7)',
        data: {}
      },
      {
        name: 'Bad',
        color: 'rgba(223, 53, 53, 0.7)',
        data: {}
      }
    ];
    colorNames = {};
    for (i = series.length - 1; i >= 0; i--) {
      colorNames[series[i].color] = series[i].name;
    }
    columnLabels = {};
    for (i = 0; i < this.config.ar_metric.length; i++) {
      metric = this.config.ar_metric[i];
      name = '';
      if (metric.group) {
        name += metric.group + '\n';
      }
      if (metric.title) {
        name += metric.title;
      } else if (metric.header) {
        name += metric.header;
      } else {
        // FIXME: use cdnDataManager.translateMetricName
        name += metric.metric;
      }
      columnLabels[metric.metric || metric.header] = name;
      for (j = 0; j < series.length; j++) {
        series[j].data[metric.metric || metric.header] = 0;
      }
    }

    for (i = 0; i < descriptions.length; i++) {
      for (j = 0; j < descriptions[i].length; j++) {
        // TODO: compare more than the first run/testsuite
        // GOLD POSITION
        //value = descriptions[i][j][0];
        value = descriptions[i][j][1];
        if (value.defined) {
          switch (value.relation) {
          case CDNMetricComparison.GOOD:
            series[0].data[value.name]++;
            break;
          case CDNMetricComparison.NEUTRAL:
          case CDNMetricComparison.GOOD_BELOW_THRESHOLD:
          case CDNMetricComparison.BAD_BELOW_THRESHOLD:
            series[1].data[value.name]++;
            break;
          case CDNMetricComparison.BAD:
            series[3].data[value.name]++;
            break;
          }
        } else {
          series[2].data[value.name]++;
        }
      }
    }

    chart = new CDNChart_column();
    CDNHelpers.removeChildren(this.headerContainer);
    this.headerContainer.appendChild(chart.init({
      arSeries: series,
      transXLabel: columnLabels,
      colorName: colorNames,
      legendLineStroke: 5,
      legendOffset: 20,
      xAxisLines: false,
      yAxisMin: 0,
      yAxisName: 'Number of runs'
    }));
  };



  /********************************
   * configuration metric wildcard expansion behavior
   */

  CDNTable.prototype._expandMetric = function(originalMetrics, deeperMetrics, callback) {
    var config;

    cdnDataManager.getAliases(function(aliases) {

    /* Regexp help for the pattern: (?:[^\.\\:]|\\.)+ When the user uses * or %,
     * we want to match anything except period (.) and colon (:) however, we do
     * want to match an escaped period (\.) but not a period after a backslash
     * (\\.) This pattern does that matching:
     * (?:      non-capturing group (just an optimisation over a capturing group)
     * [^\.\\:] not a period and not the start of an escaped character (backslash)
     * |        or
     * \\.      an escaped character (backslash followed by another character)
     * )        end of group
     * +        repeat the group to consume until we meet a period character
     */
    /* Regexp help for the pattern: (?:^|[^\\])(?:\\\\)*
     * Match an even number of \ characters. This is used to find escaped and
     * not escaped characters as needed. To match escaped, a \\ is matched after
     * this pattern.
     * (?:    non-capturing group }
     * ^      start of string     } Find the character
     * |      or                  } before a sequence
     * [^\\]  not backslash       } of backslashes
     * )      end of group        }
     * (?:    non-capturing group                          } Consume pairs of
     * \\\\   2 backslashes                                } backslashes (i.e.
     * )      end of group                                 } escaped backslash
     * *      repeat group to consume pairs of backslashes } literals)
     */

    function expandSnapshotMetrics(config) {
      var containsToken;
      containsToken = config.metrics.some(function(metric){
        if (metric.header) return false;
        if (metric.renderer && window[metric.renderer] && window[metric.renderer].no_wildcard_expansion) return false;
        // Match * or % ignoring escaped characters
        return !! metric.metric.match(/(?:^|[^\\])(?:\\\\)*(?:\*|%)/);
      });
      if (! containsToken) {
        return false;
      }
      // Because inheritance is already performed, we only need to look at the
      // metrics on the current snapshots (not the child snapshots for the
      // HorizontalTable) as they will be inherited.
      cdnDataManager.getComparableThings(function(snapshots) {
        var i, snapshot, length, metricName, metricNames, oldMetrics, pattern, metric, metricRegex, matching, prepend, append, missingMetricConfig;

        length = snapshots.length;

        metricNames = [];
        for (i = 0; i < length; i++) {
          snapshot = snapshots[i];
          if (snapshot) {
            // If the table is per-snapshot, look at the child snapshots for the
            // list of available metrics
            if (deeperMetrics && snapshot.snapshots && snapshot.snapshots.some(function(snap){return snap.hasOwnProperty('metrics')})) {
              snapshot.snapshots.map(function(snapshot) {
                var metricName;
                for (metricName in snapshot.metrics) {
                  // Use the keys of the array to de-duplicate
                  metricNames[metricName] = true;
                }
              });
            } else {
              for (metricName in snapshot.metrics) {
                // Use the keys of the array to de-duplicate
                metricNames[metricName] = true;
              }
            }
          }
        }
        metricNames = CDNHelpers.keys(metricNames);

        oldMetrics = config.metrics;
        config.metrics = [];

        for (i = 0; i < oldMetrics.length; i++) {
          metric = oldMetrics[i];
          if (metric.header) {
            config.metrics.push(metric);
            continue;
          }
          if (metric.renderer && window[metric.renderer] && window[metric.renderer].no_wildcard_expansion) {
            config.metrics.push(metric);
            continue;
          }
          // Match * or % ignoring escaped characters
          if (metric.metric.match(/(?:^|[^\\])(?:\\\\)*(?:\*|%)/)) {
            config.dependsOnSnapshot = true;
            pattern = CDNHelpers.encodeRegexp(metric.metric);
            // Replace * and % (when not originally escaped) with a regexp
            // to match anything that is not an escaped period. As the pattern
            // has been escaped for regexp safety, we need to match double the
            // number of backslashes.
            pattern = pattern.replace(/((?:^|[^\\])(?:\\\\\\\\)*)(?:\\\*|%)/g, '$1(?:[^\\.\\\\:]|\\\\.)+');
            metricRegex = new RegExp('^'+pattern+'$');
            matching = metricNames.filter(function(name){
              return !! name.match(metricRegex);
            });
            // Combine wildcarded metrics which matched against %
            if (metric.metric.match(/(?:^|[^\\])(?:\\\\)*%/)) {
              pattern = CDNHelpers.encodeRegexp(metric.metric);
              // Replace not originally escaped % with match not escaped period
              // surrounded by group markers so we can extract bits of the match
              // and replace the % with the appropriate metric name parts later
              pattern = pattern.replace(/((?:^|[^\\])(?:\\\\\\\\)*)%/g, '$1)(?:[^\\.\\\\:]|\\\\.)+(');
              // Replace * with non-grouping match so that we can use % and *
              // together
              pattern = pattern.replace(/((?:^|[^\\])(?:\\\\\\\\)*)\\\*/g, '$1(?:[^\\.\\\\:]|\\\\.)+');
              // If % was at the start or the end of the string, we need to
              // remove the group markers from the start and end as there won't
              // be anything to match
              prepend = false;
              append = false;
              if (pattern.charAt(0) === ')') {
                prepend = true;
                pattern = pattern.slice(1);
              } else {
                pattern = '(' + pattern;
              }
              if (pattern.charAt(pattern.length - 1) === '(') {
                append = true;
                pattern = pattern.slice(0, -1);
              } else {
                pattern = pattern + ')';
              }
              metricRegex = new RegExp('^'+pattern+'$');
              matching = matching.reduce(function(accumulator, value, index, matching){
                var components, name;
                // Replace the %-wildcarded element back with % so we can work
                // on it later.
                components = value.match(metricRegex).slice(1);
                name = (prepend ? '%' : '' ) + components.join('%') + (append ? '%' : '');
                if (accumulator.indexOf(name) === -1) {
                  accumulator.push(name);
                }
                return accumulator;
              }, []);
              if (matching.length === 0 &&
                  metric.metric.match(/(?:^|[^\\])(?:\\\\)*(?:%)/) &&
                  ! metric.metric.match(/(?:^|[^\\])(?:\\\\)*(?:\*)/)) {
                // We didn't match any metrics, don't contain a * but do contain
                // a %. Put the metric back into the list so that we provide the
                // "missing" column for any keyed tables
                matching = [metric.metric];
              }
            }
            // Turn the matching into metric configuration for the component
            matching = matching.map(function(metricName) {
              var expanded, parts, clone, pattern, metricRegex;
              clone = CDNHelpers.shallowClone(metric);
              clone.metric = metricName;
              if (! clone.title) {
                // Expand the wildcards to include any prefix: part so that is shown in the name
                expanded = CDNHelpers.splitUnescaped('.', metric.metric).map(function(p) {
                  if (p.match(/(?:^|[^\\])(?:\\\\)*(?:\*)/)) {
                    return '*';
                  } else {
                    return p;
                  }
                });
                pattern = CDNHelpers.encodeRegexp(expanded.join('.'));
                // Replace * (when not originally escaped) with a regexp
                // to match anything that is not an escaped period. As the pattern
                // has been escaped for regexp safety, we need to match double the
                // number of backslashes. This DOES match colon
                pattern = pattern.replace(/((?:^|[^\\])(?:\\\\\\\\)*)\\\*/g, '$1((?:[^\\.\\\\]|\\\\.)+)');
                metricRegex = new RegExp('^'+pattern+'$');
                parts = clone.metric.match(metricRegex);
                parts = parts.slice(1).map(function(part) {
                  // Use the wildcarded item as the title
                  cdnDataManager.translateMetricName(part, function(name, order){
                    part = name;
                    // Attempt a numeric sort
                    if (isNaN(+order)) {
                      clone.orderingPriority = order;
                    } else {
                      clone.orderingPriority = +order;
                    }
                  }, aliases);
                  return part;
                });
                clone.title = parts.join(' | ');
              }
              return clone;
            });
            // Sort based upon the ordering priority, alternatively alphabetically
            matching = matching.sort(function(a, b) {
              var orderA, orderB;
              // Take an unset order to mean 100 so that we can order on each
              // side
              orderA = 100;
              orderB = 100;
              if (a.orderingPriority !== undefined) {
                orderA = a.orderingPriority;
              }
              if (b.orderingPriority !== undefined) {
                orderB = b.orderingPriority;
              }
              if (orderA < orderB) {return -1;}
              if (orderA > orderB) {return 1;}
              if (a.metric < b.metric) {return -1;}
              if (a.metric > b.metric) {return 1;}
              return 0;
            });
            Array.prototype.push.apply(config.metrics, matching);
          } else {
            config.metrics.push(metric);
          }
        }
        callback(config);
      });
      return true;
    }

    config = {
      metrics: originalMetrics.slice(),
      dependsOnSnapshot: false
    };

    if (! expandSnapshotMetrics(config)) {
      callback(config);
    }

    }.bind(this));
  };
  CDNTable.prototype.updateConfig = function(newConfig, modifiedConfig) {
    var label, config, keys;

    if (! modifiedConfig) {
      this.originalConfig = newConfig;
    }

    config = CDNHelpers.shallowClone(newConfig);

    config.flip_axis = !!config.flip_axis

    if (config.ar_metric === "") {
      config.ar_metric = [];
    }

    if (config.ar_metric && config.key && CDNHelpers.firstKey(config.key)) {
      keys = [];
      for (label in config.key) {
        keys.push({
          label: label,
          metric: config.key[label]
        });
      }
      this._expandMetric(keys, config.per_snapshot, function(keyConfig) {
        var i, metrics, keysHashed, keys;
        metrics = keyConfig.metrics.map(function(metric) {
          var pattern, metricRegex, replacements, label, replacement;
          replacements = [];
          for (label in config.key) {
            // Turn the key (timing.*) into a regexp
            // Escape regexp special characters
            pattern = CDNHelpers.encodeRegexp(config.key[label]);
            // Replace (not originally escaped) * with match everything that is not an escaped period
            // First regexp: find a sequence of characters with zero or multiple
            //    of 4 backslashes (equating to even in original string) followed
            //    by \*. The characters before \* are stored in a group so they
            //    can be put back into the result.
            // Second regexp string: See CDNVerticalTable _expandMetric for
            //    description. Starts with group of even number of \ characters
            pattern = pattern.replace(/((?:^|[^\\])(?:\\\\\\\\)*)\\\*/g, '$1((?:[^\\.\\\\:]|\\\\.)+)');
            metricRegex = new RegExp('^'+pattern+'$');
            replacement = (metric.metric.match(metricRegex) || []).slice(1);
            replacements = replacements.concat(replacement);
          }
          if (replacements.length) {
            metric.replacements = replacements;
          }
          return metric;
        });
        if (config.hierarchical_separator) {
          // Doing an alphabetical sort on the metric name with shorter strings
          // (parent branches) appearing before longer strings (child branches)
          // will give us a hierarchical sort.
          metrics = metrics.sort(function(a, b) {
            var i = 0, aChar, bChar;
            a = a.metric.toString();
            b = b.metric.toString();
            // This works for empty strings as NaN != NaN
            while (a.charCodeAt(i) === b.charCodeAt(i)) {
              i++;
            }
            aChar = a.charCodeAt(i);
            bChar = b.charCodeAt(i);
            if (isNaN(aChar) && isNaN(bChar)) {
              return 0;
            } else if (isNaN(aChar)) {
              return -1;
            } else if (isNaN(bChar)) {
              return 1;
            } else {
              return aChar - bChar;
            }
          });
        }
        keysHashed = {};
        for (label in config.key) {
          keysHashed[label] = [];
        }
        for (i = 0; i < metrics.length; i++) {
          keysHashed[metrics[i].label].push(metrics[i]);
        }
        keys = [];
        for (label in config.key) {
          if (keysHashed[label].length) {
            keys.push({
              name: label,
              metrics: keysHashed[label]
            });
          }
        }
        config.key = keys;
        this._expandMetric(config.ar_metric, config.per_snapshot, function(newConfig) {
          var i;
          config.ar_metric = newConfig.metrics;
          this.visibleGraphsFromConfig(config);
          CDNPageComponent.prototype.updateConfig.call(this, config, true);
        }.bind(this));
      }.bind(this));
    } else if (config.ar_metric) {
      delete config.key;
      this._expandMetric(config.ar_metric, config.per_snapshot, function(newConfig) {
        var i;
        config.ar_metric = newConfig.metrics;
        this.visibleGraphsFromConfig(config);
        CDNPageComponent.prototype.updateConfig.call(this, config, true);
      }.bind(this));
    } else {
      this.visibleGraphsFromConfig(config);
      CDNPageComponent.prototype.updateConfig.call(this, config, true);
    }
  };
  CDNTable.prototype.configInvalid = function() {
    this.updateConfig(this.originalConfig);
  };



  // Backwards compatibility component
  function CDNVerticalTable(container, config) {
    CDNTable.apply(this, arguments);
  }
  CDNHelpers.extend(CDNTable, CDNVerticalTable);
  CDNVerticalTable.prototype.describeConfigApi = function() {
    return {
      flip_axis: {
        type: 'radio',
        label: 'Orientation',
        values: {
          'Horizontal': [true],
          'Vertical': [false, undefined]
        }
      },
      ar_metric: {
        type: 'metrics_array',
        label: 'Metrics'
      }
    };
  };
  CDNVerticalTable.prototype.updateConfig = function(newConfig, modifiedConfig) {
    var config;
    if (! modifiedConfig) {
      this.originalConfig = newConfig;
    }
    config = CDNHelpers.shallowClone(newConfig);
    config.flip_axis = ! config.flip_axis;
    CDNTable.prototype.updateConfig.call(this, config, true);
  };



  function CDNTclDictTable() {
    this.extended.apply(this, arguments);
  }
  CDNHelpers.extend(CDNVerticalTable, CDNTclDictTable);
  CDNTclDictTable.MetricComparison = function(key, values, ids) {
    this.values = values;
    this.ids = ids;
    this.extended.call(this, key);
  };
  CDNHelpers.extend(CDNMetricComparison, CDNTclDictTable.MetricComparison);
  CDNTclDictTable.MetricComparison.prototype.getMetricConfig = function(callback) {
    callback({});
  };
  CDNTclDictTable.MetricComparison.prototype._getComparableThings = function(callback) {
    this._processThings(callback, this.ids, [], [], this.values);
  };
  CDNTclDictTable.prototype._metricComparison = function(config) {
    if (config.values) {
      return new CDNTclDictTable.MetricComparison(config.metric, config.values, config.ids);
    } else {
      return this.extended.prototype._metricComparison.apply(this, arguments);
    }
  };
  CDNTclDictTable.prototype.updateConfig = function(newConfig, modifiedConfig) {
    var config, comparison;
    if (! modifiedConfig) {
      this.originalConfig = newConfig;
    }

    config = CDNHelpers.shallowClone(newConfig);

    if (config.metric.header) {
      comparison = new CDNRunHeaderComparison(config.metric.header);
    } else if (config.metric.metric) {
      comparison = new CDNMetricComparison(config.metric.metric, undefined, config.metric.metricCfg); 
    } else {
      return;
      throw "CDNTclDictTable must have a metric defined";
    }

    comparison.getValueDescriptions(function(values) {
      var attributes, i, dict, key, parsedValues, ids, templateValue;

      templateValue = [];
      // Make sure each value has the correct length
      for (i = 0; i < values.length; i++) {
        templateValue.push(undefined);
      }
      ids = values.map(function(v) {
        return v.snapshotId;
      });
      attributes = {};
      parsedValues = {};
      for (i = 0; i < values.length; i++) {
        dict = CDNHelpers.parseTclDict(values[i].rawValue);
        for (key in dict) {
          attributes[key] = true;
          if (! parsedValues[key]) {
            parsedValues[key] = CDNHelpers.shallowCloneArray(templateValue);
          }
          // Values need to look like snapshots
          parsedValues[key][i] = {
            name: key,
            value: dict[key]
          };
        }
      }

      config.ar_metric = CDNHelpers.keys(attributes).sort().map(function(attribute) {
        return {metric: attribute, values: parsedValues[attribute], ids: ids};
      });

      this.extended.prototype.updateConfig.call(this, config, true);
    }.bind(this));
  };

  window.CDNTable = CDNTable;
  window.CDNVerticalTable = CDNVerticalTable;
  window.CDNHorizontalTable = CDNTable;
  window.CDNTclDictTable = CDNTclDictTable;

})();

    <script type="text/javascript">'use strict';
//
// Top-level function so we can have a per-file var scope
(function() {

  function colorToRgba(definition) {
    if (!definition) {
      return undefined;
    }
    definition = '' + definition;
    if (definition.charAt(0) === '#') {
      definition = definition.match(/[0-9A-Fa-f]{2}/g);
      definition = definition.map(function(hex) {
        return parseInt(hex, 16);
      });
    } else {
      definition = definition.split(' ');
      definition = definition.map(function(val) {
        return +val;
      });
    }
    if (!definition.every(function(val) {
      return (val >= 0 && val < 256);
    })) {
      return undefined;
    }
    if (definition.length === 3) {
      return 'rgb('+definition.join(',')+')';
    } else if (definition.length === 4) {
      definition[3] = definition[3] / 255;
      return 'rgba('+definition.join(',')+')';
    } else {
      return undefined;
    }
  }

  function CDNHistogram(container) {
    this.data = {};
    this.seriesVisibility = {};
    if (container) {
      this.popover = document.createElement('div');
      this.popover.className = 'cdn-histogram-popover';
      this.popoverText = document.createElement('div');
      this.popover.appendChild(this.popoverText);
      this._renderBound = this.render.bind(this);
      CDNHelpers.events.add('cdndatachanged', this._renderBound);
    }
    this.extended.apply(this, arguments);
  }
  CDNHelpers.extend(CDNPageComponent, CDNHistogram);
  CDNHistogram.prototype.finalize = function() {
    this.removePopover();
    CDNHelpers.events.remove('cdndatachanged', this._renderBound);
    CDNPageComponent.prototype.finalize.apply(this, arguments);
  };

  CDNHistogram.prototype.render = function() {
    this.removePopover();
    if (this.config.metric.header) {
      this.comparison = new CDNRunHeaderComparison(this.config.metric.header);
    } else {
      this.comparison = new CDNMetricComparison(this.config.metric.metric);
    }

    this.comparison.getValueDescriptions(this.computeHistogramData.bind(this));
  };

  CDNHistogram.prototype.computeHistogramData = function(values) {
    var parsedValues, i, j, mergedLabels, labelSequencer, mergedSeries, seriesSequencer, data, runIds;

    runIds = cdnDataManager.getComparableLabels();
    // GOLD POSITION
    runIds.unshift(runIds.pop());

    parsedValues = values.map(this.parseHistogramData.bind(this));

    labelSequencer = new CDNHelpers.SequenceCombiner();
    seriesSequencer = new CDNHelpers.SequenceCombiner();
    mergedLabels = [];
    mergedSeries = [];
    this.xAxisLabel = undefined;
    this.yAxisLabel = undefined;
    this.yMax = 0;
    parsedValues.map(function(value) {
      if (value) {
        mergedLabels = labelSequencer.mergeWith(value.labels);
        mergedSeries = seriesSequencer.mergeWith(CDNHelpers.keys(value.series));
        if (value.x_axis) {
          this.xAxisLabel = value.x_axis;
        }
        if (value.y_axis) {
          this.yAxisLabel = value.y_axis;
        }
        if (value.y_max) {
          this.yMax = value.y_max;
        }
      }
    }.bind(this));

    data = {};
    for (i = 0; i < mergedLabels.length; i++) {
      data[mergedLabels[i]] = parsedValues.map(function(value, runIndex) {
        var data, index;
        data = {};
        if (value) {
          index = value.labels.indexOf(mergedLabels[i]);
          for (j = 0; j < mergedSeries.length; j++) {
            data[mergedSeries[j]] = undefined;
            if (index >= 0 && value.series[mergedSeries[j]]) {
              data[mergedSeries[j]] = {
                series: mergedSeries[j],
                label: mergedLabels[i],
                value: value.series[mergedSeries[j]].values[index]
              };
              if (parsedValues.length > 1) {
                data[mergedSeries[j]].compName = runIds[runIndex];
              }
            }
          }
        }
        return data;
      });
    }
    /* data format:
     * {
     *   "label1": [
     *     {
     *       "series1": {
     *         "compName": "T1",
     *         "series": "series1".
     *         "label": "label1",
     *         "value": 10.543
     *       },
     *       "series2": ...
     *     },
     *     ...
     *   ],
     *   "label2": ...
     * }
     *
     * labels are X-axis columns.
     * comparisons are directly inside labels
     * series are name of stack within column
     * compName is not populated if there is no comparison
     */
    this.seriesVisibility = {};
    mergedSeries.map(function(term) {
      this.seriesVisibility[term] = true;
    }.bind(this));
    this.xLabels = mergedLabels;
    this.data = data;
    if (CDNHelpers.isEmpty(this.data)) {
      CDNHelpers.removeChildren(this.container);
      this.container.textContent = 'No histogram data';
      return;
    }
    this.renderGraph();
  };
  CDNHistogram.prototype.renderGraph = function() {
    var xmlns, svg, i, j, k, width, height, labels, series, comparisonCount, x, labelMax, graphMax, value, perLabelGap, perComparison, perComparisonGap, showLabelEvery, bar, yOffset, y0, y1, labelGroup, visible, shinyCheckbox, text;
    function drawRect(color, fill, x0, y0, x1, y1) {
      var rect;
      rect = document.createElementNS(xmlns, 'rect');
      rect.setAttributeNS(null, 'stroke', color || 'none');
      if (color) {
        rect.setAttributeNS(null, 'stroke-width', '2');
      }
      rect.setAttributeNS(null, 'x', x0);
      rect.setAttributeNS(null, 'y', y0 + yOffset);
      rect.setAttributeNS(null, 'width', x1 - x0);
      rect.setAttributeNS(null, 'height', y1 - y0);
      rect.setAttributeNS(null, 'fill', fill || 'none');
      svg.appendChild(rect);
      return rect;
    }

    function drawPolygon(color, fill, x0, y0) {
      var polygon, points;

      points = Array.prototype.slice.call(arguments, 2).map(function(v, i) {
        if (i % 2 === 1) {
          return v + yOffset;
        } else {
          return v;
        }
      });

      polygon = document.createElementNS(xmlns, 'polygon');
      polygon.setAttributeNS(null, 'stroke', color || 'none');
      if (color) {
        polygon.setAttributeNS(null, 'stroke-width', '2');
      }
      polygon.setAttributeNS(null, 'points', points.join(' '));
      polygon.setAttributeNS(null, 'fill', fill || 'none');
      svg.appendChild(polygon);
      return polygon;
    }

    function drawPolyline(color, fill, x0, y0) {
      var polygon, points;

      points = Array.prototype.slice.call(arguments, 2).map(function(v, i) {
        if (i % 2 === 1) {
          return v + yOffset;
        } else {
          return v;
        }
      });

      polygon = document.createElementNS(xmlns, 'polyline');
      polygon.setAttributeNS(null, 'stroke', color || 'none');
      if (color) {
        polygon.setAttributeNS(null, 'stroke-width', '2');
      }
      polygon.setAttributeNS(null, 'points', points.join(' '));
      polygon.setAttributeNS(null, 'fill', fill || 'none');
      svg.appendChild(polygon);
      return polygon;
    }

    function drawText(color, text, originEnd, x, y, r) {
      var t;

      t = document.createElementNS(xmlns, 'text');
      t.setAttributeNS(null, 'text-anchor', originEnd ? 'end' : 'start');
      t.setAttributeNS(null, 'x', x);
      t.setAttributeNS(null, 'y', y + yOffset);
      if (r) {
        t.setAttributeNS(null, 'transform', 'rotate('+r+' '+x+','+(y + yOffset - 2)+')');
      }
      t.textContent = text;
      svg.appendChild(t);
      return t;
    }

    function valueFromY(y) {
      if (graphMax === 0) {
        return 0;
      }
      return (211 - y) / (211 / graphMax);
    }
    function scaleY(value) {
      if (graphMax === 0) {
        return 211;
      }
      return 211 - ((211 / graphMax) * value);
    }

    // Width configuration
    perComparison = 8; // Bar width
    perComparisonGap = 1;
    perLabelGap = 4;

    yOffset = (this.config.metric.title) ? 20 : 0;

    showLabelEvery = this.config.show_label_every === undefined ? 1 : Math.max(this.config.show_label_every, 1);

    labels = this.xLabels;
    series = CDNHelpers.keys(this.seriesVisibility);
    comparisonCount = cdnDataManager.getComparisonCount();
    // Y axis space = 50;
    // per-label space = perLabelGap + (comparisonCount * perComparsison) + ((comparisonCount - 1) * perComparsonGap)
    // legend = 100 (+gap of 10);
    width = 160 + ((perLabelGap + (comparisonCount * perComparison) + ((comparisonCount - 1) * perComparisonGap)) * labels.length);
    height = 260;

    xmlns = 'http://www.w3.org/2000/svg';
    svg = document.createElementNS(xmlns, 'svg');
    svg.setAttributeNS(null, 'viewBox', '0 0 ' + width + ' ' + (height + yOffset));
    svg.setAttributeNS(null, 'version', '1.1');
    svg.setAttributeNS(null, 'preserveAspectRatio', 'xMaxYMid meet');
    svg.setAttributeNS(null, 'width', width);
    svg.setAttributeNS(null, 'height', (height + yOffset));

    // Draw axis
    drawPolygon('#000', undefined, 49, 0, 49, 210);
    //drawPolygon('#000', undefined, 49, 210, width - 100, 210);

    graphMax = 0;
    // draw labels
    for (i = 0; i < labels.length; i++) {
      x = 50 + ((perLabelGap + (comparisonCount * perComparison) + ((comparisonCount - 1) * perComparisonGap)) * (i + 0.5));
      if (i % showLabelEvery === 0) {
        drawPolygon('#CCC', undefined, x, 0, x, 210);
        drawText('#000', labels[i], true, x, 220, (comparisonCount <= 1 && showLabelEvery <= 1) ? 300 : 330).setAttributeNS(null, 'class', 'pie-slice-label');
      }
      // Calculate the max Y value to set our scale
      labelMax = this.data[labels[i]].reduce(function(previous, comparison) {
        var i, total;
        total = 0;
        for (i = 0; i < series.length; i++) {
          if (comparison && comparison[series[i]] && comparison[series[i]].value !== undefined) {
            total += comparison[series[i]].value;
          }
        }
        return Math.max(previous, total);
      }, 0);
      if (labelMax > graphMax) {
        graphMax = labelMax;
      }
    }
    if (this.yMax) {
      graphMax = this.yMax;
    }
    // Draw Y axis
    drawPolygon('#000', undefined, 45, 1, 50, 1);
    drawPolygon('#000', undefined, 45, 210, 50, 210);
    drawText('#000', graphMax, true, 41, 7).setAttributeNS(null, 'class', 'pie-slice-label');
    drawText('#000', '0', true, 41, 210).setAttributeNS(null, 'class', 'pie-slice-label');

    // draw series
    for (i = 0; i < labels.length; i++) {
      x = 50 + ((perLabelGap + (comparisonCount * perComparison) + ((comparisonCount - 1) * perComparisonGap)) * i) + (perLabelGap/2);
      for (j = 0; j < comparisonCount; j++) {
        labelMax = 0;
        for (k = 0; k < series.length; k++) {
          if (!this.seriesVisibility[series[k]]) {
            continue;
          }
          value = this.data[labels[i]][j][series[k]];
          if (value && value.value > 0) {
            y0 = scaleY(labelMax + value.value);
            y1 = scaleY(labelMax);
            if (y1 - y0 < 2) {
              y0 = y1 - 2;
              labelMax += valueFromY(y0) - valueFromY(y1);
            } else {
              labelMax += value.value;
            }
            bar = drawRect(undefined, CDNColor.get(k), x, y0, x + perComparison, y1);
            bar.setAttributeNS(null, 'title', value.value+"\n"+value.series+"\n"+(value.compName ? value.compName + "\n" : '')+value.label);
            bar.addEventListener('mouseover', this.setPopover.bind(this));
            bar.addEventListener('mouseout', this.removePopover.bind(this));
          }
        }
        x += perComparison + perComparisonGap;
      }
    }

    // draw legend
    x = width - 100;
    labelMax = 12;
    for (i = series.length - 1; i >= 0; i--) {
      labelGroup = document.createElementNS(xmlns, 'g');
      labelGroup.setAttributeNS(null, 'transform', 'translate('+x+','+(labelMax + yOffset - 2)+')');
      svg.appendChild(labelGroup);
      shinyCheckbox = this.makeShinyCheckbox(CDNColor.get(i), false);
      labelGroup.appendChild(shinyCheckbox.group);
      visible = this.seriesVisibility[series[i]];
      shinyCheckbox.checked = visible;
      text = drawText('#000', series[i], false, 15, 10 - yOffset);
      text.setAttributeNS(null, 'class', 'pie-slice-label pie-slice-label-clickable');
      labelGroup.appendChild(text);
      labelGroup.addEventListener('click', this.toggleSeriesVisibility.bind(this, series[i]));
      labelMax += 14;
    }

    // axis labels
    if (this.xAxisLabel) {
      drawText('#000', this.xAxisLabel, true, width - 115, height - 5);
    }
    if (this.yAxisLabel) {
      drawText('#000', this.yAxisLabel, true, 10, 5, 270);
    }

    // title
    if (this.config.metric.title) {
      drawText('#000', this.config.metric.title, false, width/2, -10).setAttributeNS(null, 'text-anchor', 'middle');
    }

    CDNHelpers.removeChildren(this.container);
    this.container.appendChild(svg);
  };

  CDNHistogram.prototype.toggleSeriesVisibility = function(name) {
    this.seriesVisibility[name] = ! this.seriesVisibility[name];
    this.renderGraph();
  };

  CDNHistogram.prototype.setPopover = function(event) {
    var clientRect, x, y;
    if (event.target) {
      clientRect = event.target.getBoundingClientRect();
      x = clientRect.left + (clientRect.width / 2);
      y = clientRect.top;
      this.popover.style.left = x + 'px';
      this.popover.style.top = y + 'px';
      this.popoverText.textContent = event.target.getAttributeNS(null, 'title');
      this.popoverElement = event.target;
      window.document.body.appendChild(this.popover);
    };
  };

  CDNHistogram.prototype.removePopover = function(event) {
    if (event && event.target && event.target !== this.popoverElement) {
      return;
    }
    if (this.popover.parentNode) {
      this.popover.parentNode.removeChild(this.popover);
    }
  };

  CDNHistogram.prototype.parseHistogramData = function(description) {
    var value, name;

    if (! description.defined) {
      return undefined;
    }

    value = CDNHelpers.parseTclDict(description.rawValue);
    if (! value || CDNHelpers.isEmpty(value)) {
      return undefined;
    }
    if (value.labels) {
      value.labels = CDNHelpers.parseTclList(value.labels);
    } else {
      value.labels = [];
    }
    if (value.series) {
      value.series = CDNHelpers.parseTclDict(value.series);
    } else {
      value.series = {};
    }

    for (name in value.series) {
      if (value.series[name]) {
        value.series[name] = CDNHelpers.parseTclDict(value.series[name]);
        if (value.series[name] && ! CDNHelpers.isEmpty(value.series[name])) {
          // TODO: parse color values
          if (value.series[name].values) {
            value.series[name].values = CDNHelpers.parseTclList(value.series[name].values).map(function(n){return parseFloat(n, 10);});
          } else {
            value.series[name].values = [];
          }
        } else {
          value.series[name] = undefined;
        }
      } else {
        value.series[name] = undefined;
      }
    }
    return value;
  };

  CDNHistogram.prototype.makeShinyCheckbox = function(color, callback) {
    var xmlns, svg, group, background, innerGroup, elements, rect, tick, cross, luminance, ret, initialState, initialDisable;
    function setter(state) {
      if (state === undefined) {
        state = !initialState;
      }
      initialState = state;
      if (initialState) {
        cross.setAttributeNS(null, 'stroke-width', '0');
        tick.removeAttributeNS(null, 'stroke-width');
        rect.setAttributeNS(null, 'fill', color);
      } else {
        tick.setAttributeNS(null, 'stroke-width', '0');
        cross.removeAttributeNS(null, 'stroke-width');
        rect.setAttributeNS(null, 'fill', 'rgb(255,255,255)');
      }
    }
    function disabler(disable) {
      initialDisable = disable;
      if (initialDisable) {
        innerGroup.setAttributeNS(null, 'opacity', '0.5');
      } else {
        innerGroup.setAttributeNS(null, 'opacity', '1');
      }
    }
    if (!color) {
      color = 'rgb(128,128,128)';
    }
    luminance = 1;
    try {
      luminance = CDNColor.luminanceFromRgb(CDNColor.rgbFromString(color));
    } catch(e) {console.error('Unable to work out luminance for '+color, e);}
    initialState = false;
    initialDisable = false;
    xmlns = 'http://www.w3.org/2000/svg';
    svg = document.createElementNS(xmlns, 'svg');
    svg.setAttributeNS(null, 'viewBox', '0 0 12 12');
    svg.setAttributeNS(null, 'version', '1.1');
    svg.setAttributeNS(null, 'width', '12');
    svg.setAttributeNS(null, 'height', '12');
    svg.setAttributeNS(null, 'class', 'cdn-shiny-checkbox');
    group = document.createElementNS(xmlns, 'g');
    group.setAttributeNS(null, 'fill', 'none');
    group.setAttributeNS(null, 'stroke', color);
    group.setAttributeNS(null, 'stroke-width', '2');
    svg.appendChild(group);
    background = document.createElementNS(xmlns, 'rect');
    background.setAttributeNS(null, 'width', '12');
    background.setAttributeNS(null, 'height', '12');
    background.setAttributeNS(null, 'x', '0');
    background.setAttributeNS(null, 'y', '0');
    background.setAttributeNS(null, 'fill', 'rgb(255,255,255)');
    background.setAttributeNS(null, 'stroke', 'none');
    group.appendChild(background);
    innerGroup = document.createElementNS(xmlns, 'g');
    group.appendChild(innerGroup);
    rect = document.createElementNS(xmlns, 'rect');
    rect.setAttributeNS(null, 'width', '10');
    rect.setAttributeNS(null, 'height', '10');
    rect.setAttributeNS(null, 'x', '1');
    rect.setAttributeNS(null, 'y', '1');
    rect.setAttributeNS(null, 'fill', color);
    innerGroup.appendChild(rect);
    cross = document.createElementNS(xmlns, 'path');
    cross.setAttributeNS(null, 'd', 'M3 3L9 9M3 9L9 3');
    innerGroup.appendChild(cross);
    tick = document.createElementNS(xmlns, 'polyline');
    tick.setAttributeNS(null, 'points', '3 6 5 9 9 3');
    if (luminance > 2 / 3) {
      tick.setAttributeNS(null, 'stroke', 'rgb(0,0,0)');
    } else {
      tick.setAttributeNS(null, 'stroke', 'rgb(255,255,255)');
    }
    innerGroup.appendChild(tick);
    ret = {};
    Object.defineProperty(ret, 'svg', { value: svg, writable: false, enumerable: true });
    Object.defineProperty(ret, 'group', { value: group, writable: false, enumerable: true });
    Object.defineProperty(ret, 'checked', { enumerable: true, get: function(){return initialState;}, set: setter });
    Object.defineProperty(ret, 'disabled', { enumerable: true, get: function(){return initialDisable;}, set: disabler });
    ret.checked = initialState;
    ret.disabled = initialDisable;
    if (callback !== false) {
      group.addEventListener('click', function(e) {
        if (ret.disabled) {
          return;
        }
        if (callback) {
          callback(e, !ret.checked);
        }
        if (!e.defaultPrevented) {
          setter(!ret.checked);
        }
      });
    }
    return ret;
  };

  function CDNImagePlot(container) {
    var zoomButton, zoominButton, zoomoutButton;
    this.data = {};
    if (container) {
      this.disabledLayers = [];
      this.layers = {};
      this.scale = 1;
      this.svgContainer = document.createElement('div');
      this.svgContainer.className = 'cdn-imageplot-svg';
      container.appendChild(this.svgContainer);
      this.legendContainer = document.createElement('div');
      this.legendContainer.className = 'cdn-imageplot-legend';
      this.legendContainer.textContent = 'Loading...';
      container.appendChild(this.legendContainer);
      this.zoomContainer = document.createElement('div');
      this.zoomContainer.className = 'cdn-imageplot-zoom';
      zoomButton = document.createElement('a');
      zoomButton.href = '#never-visited-url';
      zoomButton.className = 'cdn-imageplot-zoom-button';
      zoomButton.addEventListener('click', this.expand.bind(this), false);
      zoominButton = document.createElement('a');
      zoominButton.href = '#never-visited-url';
      zoominButton.className = 'cdn-imageplot-zoomin-button';
      zoominButton.addEventListener('click',this.svgzoomIn.bind(this), true);
      zoomoutButton = document.createElement('a');
      zoomoutButton.href = '#never-visited-url';
      zoomoutButton.className = 'cdn-imageplot-zoomout-button';
      zoomoutButton.addEventListener('click',this.svgzoomOut.bind(this), true);
      this.zoomContainer.appendChild(zoominButton);

      this.zoomContainer.appendChild(zoomButton);

  CDNImagePlot.prototype._metricComparison = function(config, subPath) {

      return new CDNMetricComparison(config.metric, subPath);
    }
  };
  CDNImagePlot.prototype.render = function() {
    var comparisons;

    this.minWidth = this.config.min_width;
    this.maxWidth = this.config.max_width;
    this.minHeight = this.config.min_height;
    this.maxHeight = this.config.max_height;

    if (! (this.minWidth >= 0)) this.minWidth = 128;
    if (! (this.maxWidth >= 0)) this.maxWidth = 512;
    if (! (this.minHeight >= 0)) this.minHeight = 128;
    if (! (this.maxHeight >= 0)) this.maxHeight = 512;

    if (this.minWidth > this.maxWidth) this.minWidth = this.maxWidth;
    if (this.minHeight > this.maxHeight) this.minHeight = this.maxHeight;

    this.disabledLayers = [];
    this.container.setAttribute('data-single-image', 'yes');
    if (this.config.per_snapshot) {
      cdnDataManager.getComparableThings(function imagePlotSnapshotReceiver(comparableSnapshots) {
        var subPaths, length, i, snapshots, j, path, lastPath, snapshotPaths, sequencer;
        if (comparableSnapshots.length > 1) {
          // Don't include paths only in the gold snapshot
          length = comparableSnapshots.length - 1;
        } else {
          length = comparableSnapshots.length;
        }
        sequencer = new CDNHelpers.SequenceCombiner();
        subPaths = [];
        for (i = 0; i < length; i++) {
          if (comparableSnapshots[i]) {
            snapshots = comparableSnapshots[i].snapshots;
            if (snapshots) {
              snapshotPaths = [];
              for (j = 0; j < snapshots.length; j++) {
                if (! snapshots[j]) {
                  continue;
                }
                path = snapshots[j].path.split('/');
                lastPath = path[path.length - 1];
                snapshotPaths.push(lastPath);
              }
              subPaths = sequencer.mergeWith(snapshotPaths);
            }
          }
        }
        subPaths.unshift('');
        CDNHelpers.waitForAll(subPaths, function(p, intermediateCallback) {
          var comparisons;
          comparisons = (this.config.ar_metric || []).map(function(m) {
            return this._metricComparison(m, (p || undefined));
          }.bind(this));
          CDNHelpers.waitForAll(comparisons, function(m, interCallback) {
            m.getValueDescriptions(interCallback);
          }, intermediateCallback);
        }.bind(this), function(data) {
          var i, keyed;
          keyed = {};
          for (i = 0; i < subPaths.length; i++) {
            keyed[subPaths[i]] = data[i];
          }
          this.computeImagePlotData(keyed);
        }.bind(this));
      }.bind(this));
    } else {
      comparisons = (this.config.ar_metric || []).map(function(m) {
        return this._metricComparison(m);
      }.bind(this));
      CDNHelpers.waitForAll(comparisons, function(m, intermediateCallback) {
        m.getValueDescriptions(intermediateCallback);
      }, function(descriptions) {
        this.computeImagePlotData({'':descriptions});
      }.bind(this));
    }
  };

  CDNImagePlot.prototype.computeImagePlotData = function(snapshots) {
    var path, parsedValues, mergedValues, metrics, i, comparisons, j, data, sequencer, descriptions, bounds, testBounds, merged;

    function pullLayers(layer, name, path) {
      var layers, childLayers, key, childKey, uri;
      if (!layer) {return {};}
      if (!name) {name = '';}
      if (!path) {path = '';}
      uri = path + '/' + name;
      layers = {};
      if (name) {
        layers[uri] = {};
      }
      if (layer.data) {
        layers[uri].fill = layer.fill || 'transparent';
        layers[uri].stroke = layer.stroke || 'transparent';
      } else {
        for (key in layer) {
          childLayers = pullLayers(layer[key], key, path + '/' + name);
          // Need to iterate and maintain order of keys
          for (childKey in childLayers) {
            layers[childKey] = childLayers[childKey];
          }
        }
      }
      return layers;
    }

    function calculateLayerDetail(snapshots) {
      var sequencer, layers, path, metrics, i, comparisons, j, found, layerData, finalData, name;
      sequencer = new CDNHelpers.SequenceCombiner();
      layers = [];
      layerData = {};
      for (path in snapshots) {
        metrics = snapshots[path];
        for (i = 0; i < metrics.length; i++) {
          comparisons = metrics[i];
          for (j = 0; j < comparisons.length; j++) {
            found = pullLayers(comparisons[j]);
            for (name in found) {
              layerData[name] = found[name];
            }
            layers = sequencer.mergeWith(CDNHelpers.keys(found));
          }
        }
      }
      finalData = {};
      for (i = 0; i < layers.length; i++) {
        finalData[layers[i]] = layerData[layers[i]];
      }
      return finalData;
    }

    function mergeValues(parsedValues, path) {
      var level, sequencer, merged, i, newPath, result, hasData;
      if (! path) {
        path = [];
      }
      level = parsedValues.map(function(value) {
        var i;
        if (!value) {return;}
        for (i = 0; i < path.length; i++) {
          value = value[path[i]];
          if (! value) {
            break;
          }
        }
        return value;
      });
      sequencer = new CDNHelpers.SequenceCombiner();
      merged = [];
      hasData = false;
      level.map(function(value) {
        if (!value) {return;}
        if (value.data) {
          hasData = true;
        } else {
          merged = sequencer.mergeWith(CDNHelpers.keys(value));
        }
      });
      result = {
        children: {},
        visible: true
      };
      for (i = 0; i < merged.length; i++) {
        newPath = path.slice();
        newPath.push(merged[i]);
        result.children[merged[i]] = mergeValues(parsedValues, newPath);
      }
      if (CDNHelpers.isEmpty(result.children) && hasData) {
        // Flatten/Merge the layer data
        result.data = level.reduce(function(prev, now) {
          if (now && now.data) {
            return prev.concat(now.data);
          } else {
            return prev;
          }
        }, []);
        result.fill = level.reduce(function(prev, now) {
          if (now && now.fill) {
            return now.fill;
          } else {
            return prev;
          }
        }, undefined);
        result.stroke = level.reduce(function(prev, now) {
          if (now && now.stroke) {
            return now.stroke;
          } else {
            return prev;
          }
        }, undefined);
      }
      return result;
    }

    function findBounds(layer) {
      var i, j, key, bounds, layerBounds, obj;
      bounds = {
        x0:  Infinity, y0:  Infinity,
        x1: -Infinity, y1: -Infinity
      };
      if (layer) {
        if (layer.data) {
          for (i = 0; i < layer.data.length; i++) {
            obj = layer.data[i];
            switch (obj.type) {
              case 'rectangle':
                if (obj.x < bounds.x0) {bounds.x0 = obj.x;}
                if (obj.y < bounds.y0) {bounds.y0 = obj.y;}
                if (obj.x + obj.width > bounds.x1) {bounds.x1 = obj.x + obj.width;}
                if (obj.y + obj.height > bounds.y1) {bounds.y1 = obj.y + obj.height;}
                break;
              case 'circle':
                if (obj.cx - obj.r < bounds.x0) {bounds.x0 = obj.cx - obj.r;}
                if (obj.cy - obj.r < bounds.y0) {bounds.y0 = obj.cy - obj.r;}
                if (obj.cx + obj.r > bounds.x1) {bounds.x1 = obj.cx + obj.r;}
                if (obj.cy + obj.r > bounds.y1) {bounds.y1 = obj.cy + obj.r;}
                break;
              case 'point':
                // We have to somehow assume a size for a point, lets go with 5
                // units of coordinate space for no particular reason
                if (obj.cx - 5 < bounds.x0) {bounds.x0 = obj.cx - 5;}
                if (obj.cy - 5 < bounds.y0) {bounds.y0 = obj.cy - 5;}
                if (obj.cx + 5 > bounds.x1) {bounds.x1 = obj.cx + 5;}
                if (obj.cy + 5 > bounds.y1) {bounds.y1 = obj.cy + 5;}
                break;
              case 'polygon':
              case 'polyline':
                for (j = 0; j < obj.points.length; j += 2) {

                  if (obj.points[j + 1] < bounds.y0) {bounds.y0 = obj.points[j + 1];}
                  if (obj.points[j] > bounds.x1) {bounds.x1 = obj.points[j];}
                  if (obj.points[j + 1] > bounds.y1) {bounds.y1 = obj.points[j + 1];}
                }
                break;
            }
          }
        } else {
          for (key in layer) {
            layerBounds = findBounds(layer[key]);
            if (layerBounds.x0 < bounds.x0) {bounds.x0 = layerBounds.x0;}
            if (layerBounds.y0 < bounds.y0) {bounds.y0 = layerBounds.y0;}
            if (layerBounds.x1 > bounds.x1) {bounds.x1 = layerBounds.x1;}
            if (layerBounds.y1 > bounds.y1) {bounds.y1 = layerBounds.y1;}
          }
        }
      }
      return bounds;
    }

    bounds = {
      x0:  Infinity, y0:  Infinity,
      x1: -Infinity, y1: -Infinity
    };
    // Parse the snapshot data into a usable format
    for (path in snapshots) {
      metrics = snapshots[path];
      for (i = 0; i < metrics.length; i++) {
        comparisons = metrics[i];
        for (j = 0; j < comparisons.length; j++) {
          data = this.parseImagePlotData(comparisons[j]);
          testBounds = findBounds(data);
          if (testBounds.x0 < bounds.x0) {
            bounds.x0 = testBounds.x0;
          }
          if (testBounds.y0 < bounds.y0) {
            bounds.y0 = testBounds.y0;
          }
          if (testBounds.x1 > bounds.x1) {
            bounds.x1 = testBounds.x1;
          }
          if (testBounds.y1 > bounds.y1) {
            bounds.y1 = testBounds.y1;
          }
          comparisons[j] = data;
        }
        metrics[i] = comparisons;

      snapshots[path] = metrics;
    }
    this.bounds = bounds;

    this.layers = calculateLayerDetail(snapshots);

    // Merge the metrics and merge the layer structures
    for (path in snapshots) {
      metrics = snapshots[path];
      snapshots[path] = [];
      merged = [];
      for (i = 0; i < metrics.length; i++) {
        comparisons = metrics[i];
        for (j = 0; j < comparisons.length; j++) {
          if (! merged[j]) {
            merged[j] = [];

      for (i = 0; i < merged.length; i++) {

    }

    if (CDNHelpers.keys(snapshots).length > 1 || snapshots[CDNHelpers.firstKey(snapshots)].length > 1) {
      this.container.removeAttribute('data-single-image');
    } else {
      this.container.setAttribute('data-single-image', 'yes');
    }

    this.data = snapshots;
    this.renderGraph();
    this.renderLegend();
  };

  CDNImagePlot.prototype.makeShinyCheckbox = CDNHistogram.prototype.makeShinyCheckbox;

  CDNImagePlot.prototype.makeSvg = function(data, maxWidth, maxHeight, minWidth, minHeight, flightLine, saveDrawGroup) {
    var xmlns, svg, group, width, height, ratio, imageHeight;

    function drawRectangle(obj, fill, stroke) {

      rect.setAttributeNS(null, 'y', obj.y);

    function drawCircle(obj, fill, stroke) {

      circle = document.createElementNS(xmlns, 'circle');

        circle.setAttributeNS(null, 'stroke', stroke);

      circle.setAttributeNS(null, 'cx', obj.cx);
      circle.setAttributeNS(null, 'cy', obj.cy);
      circle.setAttributeNS(null, 'r', obj.r);

      return circle;

    function drawPoint(obj, fill, stroke, scale) {

      if (fill) {
        line.setAttributeNS(null, 'fill', fill);
      }
      if (stroke) {
        line.setAttributeNS(null, 'stroke', stroke);
      }
      // Bounds calculation gave points 5 units space to work within
      line.setAttributeNS(null, 'x1', obj.cx - scale);
      line.setAttributeNS(null, 'y1', obj.cy - scale);
      line.setAttributeNS(null, 'x2', obj.cx + scale);
      line.setAttributeNS(null, 'y2', obj.cy + scale);
      group.appendChild(line);
      lines = [line];
      line = document.createElementNS(xmlns, 'line');
      if (fill) {
        line.setAttributeNS(null, 'fill', fill);
      }
      if (stroke) {
        line.setAttributeNS(null, 'stroke', stroke);
      }
      // Bounds calculation gave points 5 units space to work within
      line.setAttributeNS(null, 'x1', obj.cx - scale);
      line.setAttributeNS(null, 'y1', obj.cy + scale);
      line.setAttributeNS(null, 'x2', obj.cx + scale);
      line.setAttributeNS(null, 'y2', obj.cy - scale);
      group.appendChild(line);
      lines.push(line);
      return lines;
    }

    function drawPolygon(obj, fill, stroke) {
      var polygon;

      polygon = document.createElementNS(xmlns, 'polygon');
      if (fill) {
        polygon.setAttributeNS(null, 'fill', fill);
      }
      if (stroke) {
        polygon.setAttributeNS(null, 'stroke', stroke);
      }
      polygon.setAttributeNS(null, 'points', obj.points.join(' '));

    }

    function drawPolyline(obj, fill, stroke) {

      polyline = document.createElementNS(xmlns, 'polyline');

        polyline.setAttributeNS(null, 'fill', fill);
      }

            case 'polygon':

      imageHeight = this.bounds.y0 + this.bounds.y1;

      svg.setAttributeNS(null, 'viewBox', '' + (this.bounds.x0 - 5) +

    if (width > maxWidth) {

      height = width / ratio;
    }
    if (height > maxHeight) {

    if (maxWidth === minWidth && maxWidth) {width = maxWidth;}

      this.zoomTranslate_x = 0;
      this.zoomTranslate_y = imageHeight;

    }

    return svg;
  };

  CDNImagePlot.prototype.renderGraph = function() {
    var svg, ofs_x, ofs_y;
    var parent = this;
    svg = this.makeSvg(this.data[''][0], this.maxWidth, this.maxHeight, this.minWidth, this.minHeight, this.flightLine, true);
    CDNHelpers.removeChildren(this.svgContainer);
    this.svgContainer.appendChild(svg);
    
    this.svgContainer.addEventListener("wheel", function(e) {
      e.preventDefault();
      if (e.deltaY < 1) {
        parent.svgzoomIn();
      } else {
        parent.svgzoomOut();
      }
    });
    
    var pan = function(ofs_end) {
      parent.svgPan(ofs_x, ofs_y, ofs_end);
    };
    this.svgContainer.addEventListener("mousedown", function(e) {
      ofs_x = e.clientX;
      ofs_y = e.clientY;
      svg.addEventListener("mousemove", pan, false);
    });
    this.svgContainer.addEventListener("mouseup", function(f){
      svg.removeEventListener("mousemove", pan, false);
      // get current transform values
      parent.zoomTranslate_x = parent.svgPanX;
      parent.zoomTranslate_y = parent.svgPanY;
    });
  };

  CDNImagePlot.prototype.renderLegend = function() {
    var uri, name, path, parents, children;
    var container, title, checkbox, swatch, titleText, key, checkboxes, uri, layer, shinyCheckbox;
    parents = {};
    children = {};
    CDNHelpers.removeChildren(this.legendContainer);
    for (uri in this.layers) {
      layer = this.layers[uri];
      path = uri.split('/');
      name = path[path.length - 1];
      path.splice(path.length - 1, 1);
      path = path.join('/');
      if (name) {
        container = document.createElement('div');
        parents[uri] = container;
        container.className = 'cdn-imageplot-legend-container';
        title = document.createElement('label');
        title.className = 'cdn-imageplot-legend-title';
        checkbox = document.createElement('input');
        checkbox.style.display = 'none';
        shinyCheckbox = this.makeShinyCheckbox(undefined, false);
        checkbox.type = 'checkbox';
        if (this.disabledLayers.indexOf(uri) < 0) {
          checkbox.checked = true;
          shinyCheckbox.checked = true;
        }
        children[uri] = [];
        if (path && children[path]) {
          children[path].push(checkbox);
          children[path].push(shinyCheckbox);
        }
        checkbox.addEventListener('change', function(uri, checkbox, shiny, event) {
          var i;
          shiny.checked = checkbox.checked;
          if (! checkbox.disabled) {
            children[uri].map(function(c) {
              c.disabled = !checkbox.checked;
            });
            if (checkbox.checked) {
              this.disabledLayers.splice(this.disabledLayers.indexOf(uri), 1);
            } else {
              this.disabledLayers.push(uri);
            }
            this.renderGraph();
          }
        }.bind(this, uri, checkbox, shinyCheckbox));
        title.appendChild(checkbox);
        title.appendChild(shinyCheckbox.svg);
        if (layer.fill || layer.stroke) {
          swatch = document.createElement('div');
          swatch.className = 'cdn-imageplot-legend-swatch';
          swatch.style.backgroundColor = layer.fill;
          swatch.style.borderColor = layer.stroke;
          title.appendChild(swatch);
        }
        titleText = document.createElement('span');
        titleText.textContent = name;
        title.appendChild(titleText);
        container.appendChild(title);
      }
      if (parents[path]) {
        parents[path].appendChild(container);
      } else {
        this.legendContainer.appendChild(container);
      }
    }
  };

  CDNImagePlot.prototype.parseImagePlotData = function(description) {

        }

      value = value.filter(function(v) {

      // Build up our parsed objects from the tokens
      for (i = 0; i < value.length;) {
        obj = {};
        // Do we have a string (change of type)?
        if (('' + value[i]) === value[i]) {
          switch (value[i].charAt(0)) {
            case 'R':

              break;
            case 'B':
              type = 'box';
              break;
            case 'G':
              type = 'polygon';
              break;
            case 'L':
              type = 'polyline';
              break;
            case 'C':
              type = 'circle';
              break;
            case 'P':
              type = 'point';
              break;
            default:
              console.error('Unknown type for ImagePlot: '+value[i].charAt(0));
              type = undefined;
              break;
          }
          withValue = (value[i].charAt(1) === 'V');
          i += 1;
        }
        if (! type) {
          // skip to the next type marker
          for (j = i; j < value.length; j++) {
            if (('' + value[j]) === value[j]) {
              i = j;
              type = true;
              break;
            }
          }
          if (type) {
            continue;
          }
          break;
        }
        obj.type = type;
        switch (type) {
          case 'rectangle':
            obj.x = value[i];
            obj.y = value[i + 1];
            obj.width = value[i + 2];
            obj.height = value[i + 3];
            i += 4;
            break;
          case 'box':
            obj.type = 'rectangle';
            obj.x = value[i];
            obj.y = value[i + 1];
            obj.width = value[i + 2] - obj.x;
            obj.height = value[i + 3] - obj.y;
            i += 4;
            break;
          case 'circle':
            obj.cx = value[i];
            obj.cy = value[i + 1];
            obj.r = value[i + 2];
            i += 3;
            break;
          case 'point':
            obj.cx = value[i];
            obj.cy = value[i + 1];
            i += 2;
            break;
          case 'polygon':
          case 'polyline':
            // find the end of the polygon/polyline
            for (j = i + 1; j < value.length; j++) {
              if (('' + value[j]) === value[j]) {
                break;
              }
            }
            if (withValue) {
              j--;
            }
            obj.points = value.slice(i, j);
            i = j;
            break;
          default:
            console.error('Unhandled type for ImagePlot: '+value[i].charAt(0));
            // This results in infinite loops
            return;
        }
        if (withValue) {
          obj.value = value[i];
          i += 1;
        }
        paths.push(obj);
      }
      return paths;
    }

    function parseNestedData(value) {
      var key;
      if (! value || CDNHelpers.isEmpty(value)) {
        return undefined;
      }
      if (value.data != undefined) {
        value.data = parsePathData(value.data);
        if (value.fill_color) {
          value.fill = colorToRgba(value.fill_color);
          delete value.fill_color;
        }
        if (value.stroke_color) {
          value.stroke = colorToRgba(value.stroke_color);
          delete value.stroke_color;
        }
      } else {
        for (key in value) {
          value[key] = parseNestedData(CDNHelpers.parseTclDict(value[key]));
        }
      }
      return value;
    }

    if (! description || ! description.defined) {
      return undefined;
    }

    dict = CDNHelpers.parseTclDict(description.rawValue);
    if (dict.bounding_box) {
      bounds = CDNHelpers.parseTclList(dict.bounding_box);
      if (bounds.length === 4 && ! bounds.some(function(b) {return isNaN(+b);})) {
        // Valid bounding_box, but we do not support it (vivid does)
        delete dict.bounding_box;
      }
    }
    value = parseNestedData(dict);
    return value;
  };

  
  CDNImagePlot.prototype.renderFlightLine = function(points, size) {
    var xmlns, line, circle, circle_x, circle_y, i, square, square_x, square_y, triangle, triangle_x, triangle_y, tri_ax, tri_ay, tri_bx, tri_by, tri_cx, tri_cy;
    xmlns = 'http://www.w3.org/2000/svg';

      size = this.scale * 5;
    } else {
      this.flightLineIncrSize += size
      size = (this.scale * 5) - this.flightLineIncrSize;
    }

    if (points && size > 0) {
      if (this.flightLine) {
        this.designGroup.removeChild(this.flightLine);
        this.flightLine = undefined;
      }

      this.flightLine = document.createElementNS(xmlns, 'g');
      this.flightLine.setAttributeNS(null, 'fill', 'none');
      this.flightLine.setAttributeNS(null, 'stroke-width', (size / 5));
      line = document.createElementNS(xmlns, 'polyline');
      line.setAttributeNS(null, 'stroke', 'black');
      line.setAttributeNS(null, 'stroke-width', size / 2);
      line.setAttributeNS(null, 'stroke-linejoin', 'bevel');
      line.setAttributeNS(null, 'stroke-linecap', 'butt');
      line.setAttributeNS(null, 'points', points.map(function(p){return p.join(' ')}).join(' '));
      
      circle_x = points[0][0];
      circle_y = points[0][1];
      circle = document.createElementNS(xmlns, 'circle');
      circle.setAttributeNS(null, 'fill', 'rgb(0,225,0)');
      circle.setAttributeNS(null, 'stroke', 'rgb(0,0,0)');
      circle.setAttributeNS(null, 'cx', circle_x);
      circle.setAttributeNS(null, 'cy', circle_y);
      circle.setAttributeNS(null, 'r', (size));
      
      triangle_x = points[points.length-1][0];
      triangle_y = points[points.length-1][1];
      tri_ax = triangle_x;
      tri_ay = triangle_y + (size);
      tri_bx = triangle_x - (size);
      tri_by = triangle_y - (size);
      tri_cx = triangle_x + (size);
      tri_cy = tri_by;
      triangle = document.createElementNS(xmlns, 'polygon');
      triangle.setAttributeNS(null, 'fill', 'rgb(225,0,0)');
      triangle.setAttributeNS(null, 'stroke', 'rgb(0,0,0)');
      triangle.setAttributeNS(null, 'points', [tri_ax, tri_ay, tri_bx, tri_by, tri_cx, tri_cy].join(", "));
      this.flightLine.appendChild(line);
      
      for (i = 1; i < points.length-1; i++){
        square = document.createElementNS(xmlns, 'rect');
        square.setAttributeNS(null, 'fill', 'rgb(225,255,255)');
        square.setAttributeNS(null, 'stroke', 'rgb(0,0,0)');
        square.setAttributeNS(null, 'width', (size));
        square.setAttributeNS(null, 'height', (size));
        square_x = points[i][0] - size / 2;
        square_y = points[i][1] - size / 2;
        square.setAttributeNS(null, 'x', square_x);
        square.setAttributeNS(null, 'y', square_y);
        this.flightLine.appendChild(square);
      }
      
      this.flightLine.appendChild(circle);
      this.flightLine.appendChild(triangle);
      this.designGroup.appendChild(this.flightLine);
    }

    this.flightLinePoints = points;
  };

  CDNImagePlot.prototype.svgzoomIn = function(event) {

  // Pan on svg floorplan image
  CDNImagePlot.prototype.svgPan = function(offset_startX, offset_startY,  offset_end, event) {
    var final_transform, diff_x, diff_y, mousemove_x, mousemove_y, mouseclick_x, mouseclick_y;
    //convert the screen coordinate system to the SVG coordinate system
    var CTM = this.svgGroup.getScreenCTM();
    mousemove_x = (offset_end.clientX - CTM.e) / CTM.a; 
    mousemove_y = (offset_end.clientY - CTM.f) / CTM.d; 
    mouseclick_x  = (offset_startX - CTM.e) / CTM.a; 
    mouseclick_y  = (offset_startY - CTM.f) / CTM.d;

    this.svgPanX = this.zoomTranslate_x + mousemove_x - mouseclick_x;
    this.svgPanY = this.zoomTranslate_y - mousemove_y + mouseclick_y;  

    final_transform = "translate(";
    final_transform += this.svgPanX;
    final_transform += ",";
    final_transform += this.svgPanY;
    final_transform += ")";
    final_transform += " scale(";
    final_transform += this.zoomScale_x;
    final_transform += ",";
    final_transform += this.zoomScale_y;
    final_transform += ")";

    this.svgGroup.setAttribute("transform", final_transform);
    
  };

  // zoom-in and zoom-out on svg floorplan image
  CDNImagePlot.prototype.svgzoomInOut = function(zoom, event) {
    var final_transform, scale_value;
    
    if(zoom === 'zoomIn') {
      this.zoomTranslate_x -= 14.0;
      this.zoomTranslate_y += 15.0;
      this.zoomScale_x += 0.2;
      this.zoomScale_y -= 0.2;
      scale_value = 0.08;
    } else if(zoom === 'zoomOut') {
      if (this.zoomScale_x >= 1 && this.zoomScale_y <= -1) {
        this.zoomTranslate_x += 14.0;
        this.zoomTranslate_y -= 15.0;
        this.zoomScale_x -= 0.2;
        this.zoomScale_y += 0.2;
        scale_value = -0.08;
      }
    } 

    final_transform = "translate(";
    final_transform += this.zoomTranslate_x;
    final_transform += ",";
    final_transform += this.zoomTranslate_y;
    final_transform += ")";
    final_transform += " scale(";
    final_transform += this.zoomScale_x;
    final_transform += ",";
    final_transform += this.zoomScale_y;
    final_transform += ")";

    this.svgGroup.setAttributeNS(null, "transform", final_transform);
    this.renderFlightLine(this.flightLinePoints, scale_value);
  }

  CDNImagePlot.prototype.expand = function(event) {
    var config;
    if (event) {

    }
    if (this.carousel) {

    }
    config = {

    };
    this.carousel = new CDNImageDiffCarousel(config);

  };
  CDNImagePlot.prototype.collapse = function() {
    if (this.carousel) {
      this.carousel.hide();
      delete this.carousel;
    }
  };

  window.CDNImagePlot = CDNImagePlot;

            alias.textContent = '';
          }
        });
      }
      if (this.metricComparison) {
        snapshot.textContent = '...';
        if (this.values[index].number) {
          rendered.textContent = this.values[index].renderedValue + ' ...';
        }
        description.textContent = '...';
        this.metricComparison.newRelatedComparison('_name_').getValueDescriptions(function(values) {
          if (values[index] && values[index].defined) {
            snapshot.textContent = values[index].renderedValue;
          } else {
            snapshot.textContent = '';
          }
        });
        this.metricComparison.getMetricConfig(function(config) {
          if (config) {
            if (config.description) {
              description.textContent = config.description;
            } else {
              description.textContent = '';
            }
            if (config.units && this.values[index].number) {
              rendered.textContent = this.values[index].renderedValue + ' ' + config.units;
            } else {
              rendered.textContent = this.values[index].renderedValue;
            }
          } else {
            rendered.textContent = this.values[index].renderedValue;
            description.textContent = '';
          }
        }.bind(this));
      }
      this.popoverElement = event.target;
      window.document.body.appendChild(this.popover);

  CDNDataCell.prototype.removePopover = function(index, event) {
    clearTimeout(this.popoverTimeout);
    if (event && event.target && event.target !== this.popoverElement) {
      return;
    }
    if (this.popover.parentNode) {
      this.popover.parentNode.removeChild(this.popover);
    }
